import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import * as API from '../services/api';
import TransactionList from '../components/TransactionList';

function EditPage() {
  const navigate = useNavigate();
  const [transactions, setTransactions] = useState([]);
  const [form, setForm] = useState({ description: '', amount: '', category: '' });
  const [error, setError] = useState('');
  const [defaultUser, setDefaultUser] = useState(null);

  const categories = [
    'Salary', 'Freelance', 'Investment',
    'Food', 'Transportation', 'Entertainment',
    'Shopping', 'Bills', 'Healthcare',
    'Education', 'Other'
  ];

  // Load transactions for the given user
  const loadTransactions = () => {
    if (!defaultUser) return;
    API.getTransactions()
      .then(data => setTransactions(data || []))
      .catch(err => {
        console.error(err);
        setTransactions([]);
      });
  };

  // On mount, get default user and load their transactions
  useEffect(() => {
    API.getDefaultUser()
      .then(user => {
        setDefaultUser(user);
        loadTransactions();
      })
      .catch(err => {
        console.error(err);
        setTransactions([]);
      });
  }, []);

  // Add a transaction
  const submit = () => {
    if (!defaultUser) return;

    const payload = {
      description: form.description,
      amount: parseFloat(form.amount),
      category: form.category,
      type: parseFloat(form.amount) >= 0 ? 'income' : 'expense',
      user: defaultUser._id
    };

    API.addtransaction(payload)
      .then(() => {
        setForm({ description: '', amount: '', category: '' });
        setError('');
        loadTransactions();
      })
      .catch(err => {
        console.error(err.response?.data || err);
        setError(err.response?.data?.error || 'Error adding transaction');
      });
  };

  // Delete a transaction
  const remove = (id) => {
    API.deleteTransaction(id)
      .then(() => loadTransactions())
      .catch(err => console.error(err.response?.data || err));
  };

  return (
    <div style={{ padding: 20 }}>
      <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
        <button onClick={() => navigate('/')}>Back</button>
        <h1 style={{ textAlign: 'center', flexGrow: 1 }}>Edit Transactions</h1>
      </div>

      <h3 style={{ textAlign: 'center', marginTop: 20 }}>Add Transaction</h3>
      {error && <div style={{ color: 'red', textAlign: 'center' }}>{error}</div>}

      <div style={{ display: 'flex', justifyContent: 'center', gap: 10, marginTop: 10 }}>
        <input
          placeholder="Description"
          value={form.description}
          onChange={(e) => setForm({ ...form, description: e.target.value })}
          style={{ width: 150 }}
        />
        <input
          placeholder="Amount"
          type="number"
          value={form.amount}
          onChange={(e) => setForm({ ...form, amount: e.target.value })}
          style={{ width: 100 }}
        />
        <select
          value={form.category}
          onChange={(e) => setForm({ ...form, category: e.target.value })}
          style={{ width: 150 }}
        >
          <option value="">Select Category</option>
          {categories.map((cat) => (
            <option key={cat} value={cat}>{cat}</option>
          ))}
        </select>
        <button onClick={submit}>Add</button>
      </div>

      <h3 style={{ marginTop: 40 }}>Existing Transactions</h3>
      {transactions.length === 0 && <div>No transactions found.</div>}
      <TransactionList transactions={transactions} remove={remove} />
    </div>
  );
}

export default EditPage;
